import React from "react";

const Login = () => {
  return (
    <div className="login">
      <input type="text" className="inputBox" placeholder="Enter email"></input>
      <input
        type="password"
        className="inputBox"
        placeholder="Password"
      ></input>
      <button className="button" type="button">
        Login
      </button>
    </div>
  );
};
export default Login;
